import Foundation
import UIKit
import SnapKit
import RxSwift
import RxCocoa
import RxDataSources
import Kingfisher

// TODO: ADD: Horizontal Collection View
class RestaurantTableViewCell: UITableViewCell {
    static var reuseIdentifier: String {
        get {
            return "RestaurantTableViewCell"
        }
    }

    var disposeBag: DisposeBag = DisposeBag()

    var onSelectRestaurant: ((_ item: RestaurantItem) -> Void)?

    var restaurantItemsData: [RestaurantItem] = [] {
        didSet {
            restaurantItems.onNext(restaurantItemsData)
        }
    }
    var restaurantItems = BehaviorSubject<[RestaurantItem]>(value: [])

    lazy var titleLabel: UILabel = {
        let label = UILabel()

        label.numberOfLines = 0
        label.font = .boldSystemFont(ofSize: CGFloat(NumberConstants.restaurantTableViewTitleLabelSize))
        label.textColor = .white

        return label
    }()

    lazy var collectionViewLayout: UICollectionViewFlowLayout = {
        let layout = UICollectionViewFlowLayout()
        layout.itemSize = CGSize(width: NumberConstants.restaurantCollectionViewCellSize, height: NumberConstants.restaurantCollectionViewCellSize)
        layout.sectionInset = UIEdgeInsets(top: 0, left: 0, bottom: 0, right: 0)
        layout.scrollDirection = .horizontal

        return layout
    }()

    lazy var collectionView: UICollectionView = {
        let collectionView = UICollectionView(frame: CGRect.zero, collectionViewLayout: collectionViewLayout)

        collectionView.register(RestaurantCollectionViewCell.self, forCellWithReuseIdentifier: RestaurantCollectionViewCell.reuseIdentifier)

        collectionView.translatesAutoresizingMaskIntoConstraints = false
        collectionView.backgroundColor = .clear

        return collectionView
    }()

    required init?(coder: NSCoder) {
        super.init(coder: coder)

        setupViews()
        setupBind()

    }

    override init(style: UITableViewCell.CellStyle, reuseIdentifier: String?) {
        super.init(style: style, reuseIdentifier: reuseIdentifier)

        setupViews()
        setupBind()

    }

    private func setupViews() {
        self.backgroundColor = .clear
        contentView.addSubview(titleLabel)
        contentView.addSubview(collectionView)

        titleLabel.snp.makeConstraints { make in
            make.top.equalToSuperview()
            make.leading.equalToSuperview()
            make.trailing.equalToSuperview()
        }

        collectionView.snp.makeConstraints { make in
            make.top.equalTo(titleLabel.snp.bottom).offset(NumberConstants.layoutMarginMidium)
            make.bottom.equalToSuperview().offset(-NumberConstants.layoutMarginExtra)
            make.leading.equalToSuperview()
            make.trailing.equalToSuperview()
            make.height.equalTo(NumberConstants.restaurantCollectionViewCellSize)
        }

    }

    private func setupBind() {

        collectionView.register(RestaurantCollectionViewCell.self, forCellWithReuseIdentifier: RestaurantCollectionViewCell.reuseIdentifier)

        restaurantItems.bind(to: collectionView.rx.items(cellIdentifier: RestaurantCollectionViewCell.reuseIdentifier, cellType: RestaurantCollectionViewCell.self)) { (row, item, cell) in

            cell.restaurantNameLabel.text = item.restaurant_name
            cell.restaurantMainImageView.kf.setImage(
                with: URL(string:
                            item.image_urls?.first?.addingPercentEncoding(withAllowedCharacters: .urlQueryAllowed) ?? ""),
                placeholder: ImageConstants.placeholder
            )

        }.disposed(by: self.disposeBag)

        collectionView.rx.itemAndIndexSelected(RestaurantItem.self)
            .subscribe(onNext: { (item, index) in

                self.onSelectRestaurant?(item)

            }).disposed(by: self.disposeBag)

    }
}

